public:
    // cppcheck-suppress uninitDerivedMemberVar - we call Stream::init() to initialize the private members
    EXPLICIT StdIStream(std::istream &istr)
        : istr(istr) {
        assert(istr.good());
        init();
    }

    virtual int get() OVERRIDE {
        return istr.get();
    }
    virtual int peek() OVERRIDE {
        return istr.peek();
    }
